import { useState } from "react";
import { useNavigate } from "react-router-dom";

function ContractPage() {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    jobId: "",
    salary: "",
    probation: "",
    startDate: "",
    endDate: "",
    benefits: "",
  });

  const handleChange = (e) => {
    setFormData((prevData) => ({
      ...prevData,
      [e.target.name]: e.target.value,
    }));
  };

  return (
    <div className="flex flex-col items-center p-6 space-y-4 bg-gray-100 min-h-screen">
      <button
        className="px-4 py-2 bg-blue-500 text-white rounded hover:bg-blue-700"
        onClick={() => navigate(-1)}
      >
        Back
      </button>
      <h2 className="text-2xl font-semibold">Contract</h2>
      <div className="w-full max-w-lg bg-white p-6 rounded-lg shadow-md">
        <div className="space-y-4">
          <label className="block">Job ID</label>
          <select
            name="jobId"
            value={formData.jobId}
            onChange={handleChange}
            className="w-full p-2 border rounded"
          >
            <option value="" disabled>Select Job ID</option>
            <option value="101">101</option>
            <option value="102">102</option>
          </select>

          <label className="block">Salary</label>
          <select
            name="salary"
            value={formData.salary}
            onChange={handleChange}
            className="w-full p-2 border rounded"
          >
            <option value="" disabled>Select Salary</option>
            <option value="50000">$50,000</option>
            <option value="60000">$60,000</option>
          </select>

          <label className="block">Probation Period</label>
          <select
            name="probation"
            value={formData.probation}
            onChange={handleChange}
            className="w-full p-2 border rounded"
          >
            <option value="" disabled>Select Probation Period</option>
            <option value="3">3 months</option>
            <option value="6">6 months</option>
          </select>

          <label className="block">Contract Start Date</label>
          <input
            type="date"
            name="startDate"
            value={formData.startDate}
            onChange={handleChange}
            className="w-full p-2 border rounded"
          />

          <label className="block">Contract End Date</label>
          <input
            type="date"
            name="endDate"
            value={formData.endDate}
            onChange={handleChange}
            className="w-full p-2 border rounded"
          />

          <label className="block">Benefits</label>
          <select
            name="benefits"
            value={formData.benefits}
            onChange={handleChange}
            className="w-full p-2 border rounded"
          >
            <option value="" disabled>Select Benefits</option>
            <option value="Health Insurance">Health Insurance</option>
            <option value="Yearly Bonus">Yearly Bonus</option>
          </select>
        </div>
      </div>
      <button
        className="px-6 py-2 bg-green-500 text-white rounded hover:bg-green-700 disabled:opacity-50"
        disabled={Object.values(formData).some((value) => value === "")}
      >
        Submit
      </button>
    </div>
  );
}

export default ContractPage;
